use crowd_funding_fulfillment;




    

-- insert SKUs 

    











select 
	co.contact_order_id,
    ca.address_id,
    'SHIPPING'
from contact_order co
left join order_address oa on oa.contact_order_id = co.contact_order_id
join contact_address ca on ca.contact_id = co.contact_id
where oa.contact_order_id is null;

-- Set local pickup orders
create temporary table contact_order_ids (
	contact_order_id int
);

select 
	co.contact_order_id
from contact_order co
left join order_address oa on oa.contact_order_id = co.contact_order_id
where oa.contact_order_id is null;

update contact_order set
	local_pickup = 1
where contact_order_id in (select contact_order_id from contact_order_ids);

drop temporary table contact_order_ids;
-- end local pickup



